 more -->\\n\\n## 示例\\n\\n**输入**\\n```markdown\\nThe background color should be `#ffffff` for light mode and `#0d1117` for dark mode.\\n```\\n\\n**输出**\\n\\nThe background color should be `#ffffff` for light mode and `#0d1117` for dark mode.\\n\\n## 支持的颜色格式\\n以下是当前支持的颜色模型。\\n\\n| 颜色\\t  | 格式\\t            | 输入\\t                                      | 输出                          |\\n|------|----------------|------------------------------------------|-----------------------------|\\n| HEX  | \\t`#RRGGBB`\\t    | `#0969DA`                                | \\t`#0969DA`                  |\\n| RGB  | \\t`rgb(R,G,B)`\\t | `rgb(9, 105, 218)`   `rgb(9%, 10%, 21%)` | \\t`rgb(9, 105, 218)`  `rgb(9%, 10%, 21%)`       |\\n| RGBA | \\t`rgba(R,G,B)`\\t | `rgba(9, 105, 218, 0.5)`                 | \\t`rgba(9, 105, 218, 0.5)`   |\\n| HSL  | \\t`hsl(H,S,L)`\\t | `hsl(212, 92%, 45%)`                     | \\t`hsl(212, 92%, 45%)`       |\\n| HSLA | \\t`hsla(H,S,L)`\\t | `hsla(212, 92%, 45%, 0.5)`               | \\t`hsla(212, 92%, 45%, 0.5)` |\\n","icon":"bg-colors","author":[{"name":"shentuzhigang","email":"shentuzhigang01@weidian.com"}],"top":false,"length":196,"words":196,"readingTime":0.65}');export{e as data};
